  \"2016-07-27T22:18:18.605104\",\n\t\"name\": \"stillwater-wildlife-management-area-anaho-island-nwr-fallon-nwr-refuge-narrative-report-19\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This refuge narrative report details the
  conditions and management of Stillwater Wildlife Management Area in 1968.  The report
  begins with general information about weather and habitat conditions on the refuge.
  \ The second section of the report describes wildlife on the refuge and includes
  migratory birds, upland game birds, big game animals, fur animals, predators, rodents,
  predaceous birds, fish, and reptiles.  The report then covers the refugeu2019s development
  and maintenance projects such as: physical development, plantings, collections and
  receipts, vegetation control, planned burning, and fires.  The fourth section of
  the report includes information about resource management including: grazing, haying,
  fur harvesting, timber removal, and commercial fishing.  The next section describes
  field investigations, research, and waterfowl banding.  Finally, public relations,
  refuge visitors, and hunting activities are described.  Information about Anaho
  Island National Wildlife Refuge and Fallon National Wildlife Refuge is also provided
  in this report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
